    "An Integration Platform for Dual-Polarized W-Band Antenna Arrays Project",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T15:21:52.175372",nt"name": "an-integration-platform-for-dual-polarized-w-band-antenna-arrays-project",nt"isopen":
    true,nt"url": null,nt"notes": "A few NASA decadal missions such as the
    Aerosol Clouds Ecosystems (ACE) mission require space-based millimeter-wave radar
    apertures to complete the science objectives. We propose to create dual-polarized
    microfabricated copper-based antenna apertures with integrated MMICs that go beyond
    the capabilities funded to date at the upper frequencies of interest by enabling
    electronic scanning at W-band frequencies, while not precluding the co-location
    of Ka-band capability in the same aperture. This Phase II effort will constitute
    element-, feed-, MMIC-, and array-level analyses of the trade space for the proposed
    aperture. In addition we will provide a hardware demonstration of a W-band transmit/receive
    array tile showing MMIC integration on the necessary scale for W-band phased arrays
    and high-efficiency dual polarized antenna elements.",nt"license_title": "U.S.
